// draw_building --> draws the building blocks based on block number
void draw_building(int column, int num, bool erase){
	if(erase){
		for(int row = 0; row < BUILDING_SIZE; row++){
			for(int col = 0; col < BUILDING_SIZE; col++){
				plot_pixel(column + row, num + col, BLEU_BLUE);
			}
		}
	}
	// x = (column * 20) + 40 (40 is offset)
	// y = GROUND - (i * 20)
	// for loop to iterate and build based on column height
	else{
		for(int i = 0; i < num; i++){
			// inner loop for actual x and y
			for(int row = 0; row < BUILDING_SIZE; row++){
				for(int col = 1; col < BUILDING_SIZE + 1; col++){
					plot_pixel((column * 20) + OFFSET + row, (GROUND) - (20 * i) - col, DIM_GRAY);
				}
			}
		}
		if(num > start_height[column]){
			for(int i = 0; i < num - start_height[column]; i++){
				draw_windows(OFFSET + (column * 20), y_arr[column] + 20 * i + 1, window[column][i]);
			}
		}
	}
}

// gen_building --> generate randomized set of buildings
void gen_building(){
	int total = (BOMB_NUM * ROUNDS) - difficulty_range[index];
	int col_count = 0;
	int block_num = 0;
	// while loop to generate buildings
	// conditions: if total doesnt reach 0, and total columns reached
	while(col_count < NUM_COLUMNS){
		// randomized column height
		block_num = rand() % BUILDING_MAX;
		// if the total left is less than the block_num, set block_num to the remaining total, total = 0
		// else subtract from total
		if(block_num > total){
			block_num = total;
			total = 0;
		}
		else{
			total = total - block_num;
		}
		// set the column array value
		col_arr[col_count] = block_num;
		y_arr[col_count] = (GROUND - 1) - col_arr[col_count] * 20;

		// randomize start heights for windows
		start_height[col_count] = (rand() % 2) + 1;

		// increment count 
		col_count++;
	}
	// random window generation
	int start;
	for(int i = 0; i < NUM_COLUMNS; i++){
		if(col_arr[i] > start_height[i]){
			for(int j = 0; j < col_arr[i] - start_height[i]; j++){
				if(j == col_arr[i] - start_height[i] - 1){	  // draws from the top, so last value should be the connector
					window[i][j] = 4;        				 // connector pattern is 4
				}
				else{
					window[i][j] = (rand() % 3) + 1;
				}
			}
		}
	}
}

void plane_animation(){
	// PLANE ANIMATION
	// Plane indexing
	int plane_index = (plane_x - OFFSET + PLANE_SIZE) / 20; 
	// Clear the screen: erase
	draw_plane(plane_oldx, plane_oldy, ERASE);	
	// Draw the new position of the plane
	if(plane_x == RESOLUTION_X){
		// pause the plane until all bombs reset
		for(int i = 0; i < BOMB_NUM; i++){
			if(bomb_xarr[i] != RESOLUTION_X || bomb_yarr[i] != 0){
				return;
			}
		}
	}
	else{
		draw_plane(plane_x, plane_y, CREATE);
	}
	// Update the location of the plane
	// Keep track of the last last position
	if(plane_x == 0){
		plane_oldx = 0;
	}
	else{
		plane_oldx = plane_x - plane_speed;	
	}

	if(plane_x == RESOLUTION_X / 4 && col_empty && plane_y == 180){
		plane_speed = plane_speed / 2;
	}

	plane_oldy = plane_y;
	// Check boundary conditionsa
	if(plane_x == RESOLUTION_X){
		plane_oldx = RESOLUTION_X - plane_speed;
		plane_oldy = plane_y;
		plane_x = 0;
		plane_y += 20;		// move down to the next row
		bomb_count = 0;		// reset the bomb count
		if(plane_y == 180){
			for(int i = 0; i < NUM_COLUMNS; i++){
				if(col_arr[i] != 0){
					col_empty = false;
				}
			}
		}
	}
	// if plane hits a building
	// (plane_x - 40) / 20 will give index of the col_arr
	else if((plane_y == y_arr[plane_index] + 1) && plane_index >= 0 && plane_index < 12){
		// draw plane explosion?
		end = true;
		crash = true;
	}
	else if(plane_y == 180 && plane_speed == 1 && plane_x == RESOLUTION_X / 2){
		end = true;
		win = true;
	}
	else{
		plane_x += plane_speed;
	}
}
// draw --> do both the animations for the plane and the bomb?
void bomb_animation(){
	// BOMB ANIMATION
	// For loop to iterate through all the bombs
	for(int i = 0; i < BOMB_NUM; i++){
		// Bomb indexing
		bomb_index_l[i] = (bomb_xarr[i] - OFFSET) / 20;
		bomb_index_r[i] = (bomb_xarr[i] + BOMB_WIDTH - OFFSET) / 20;
		// Clear/erase
		draw_bomb(bomb_oldx[i], bomb_oldy[i], ERASE);
		// Draw the new location of the bomb
		if(bomb_yarr[i] + BOMB_SIZE == GROUND + bomb_speed){
			// skip
		}
		else if(bomb_xarr[i] == RESOLUTION_X){
			// skip
		}
		else if((bomb_yarr[i] + BOMB_SIZE ==  y_arr[bomb_index_l[i]] + 1 + bomb_speed) && bomb_index_l[i] >= 0 && bomb_index_l[i] < 12){
			// skip
		}
		else if((bomb_yarr[i] + BOMB_SIZE ==  y_arr[bomb_index_r[i]] + 1 + bomb_speed) && bomb_index_r[i] >= 0 && bomb_index_r[i] < 12){
			// skip
		}
		else{
			draw_bomb(bomb_xarr[i], bomb_yarr[i], CREATE);
		}
		// Update the location of the bombs
		// Keep track of the last last position
		if(bomb_yarr[i] == 0){
			bomb_oldy[i] = 0;
		}
		else{
			bomb_oldy[i] = bomb_yarr[i] - bomb_speed;
		}
		bomb_oldx[i] = bomb_xarr[i];
		// Check boundary conditions
		if(bomb_yarr[i] + BOMB_SIZE == GROUND + bomb_speed){
			bomb_oldy[i] = GROUND - BOMB_SIZE;
			bomb_oldx[i] = bomb_xarr[i];
			bomb_xarr[i] = RESOLUTION_X; 	// set location off the map
			bomb_yarr[i] = 0;
		}
		// can reduce this code
		// right corner check
		else if((bomb_yarr[i] + BOMB_SIZE == y_arr[bomb_index_r[i]] + 1 + bomb_speed) && bomb_index_r[i] >= 0 && bomb_index_r[i] < 12){ 	// check bomb_hitbox
			// erase block
			bomb_oldy[i] = y_arr[bomb_index_r[i]] + 1 - BOMB_SIZE;
			bomb_oldx[i] = bomb_xarr[i];
			bomb_xarr[i] = RESOLUTION_X; 	// set location off the map
			bomb_yarr[i] = 0;
			// decrement the y_arr, col_arr?
			y_arr[bomb_index_r[i]] += BUILDING_SIZE;
			col_arr[bomb_index_r[i]] -= 1;
			// set explosion stage to start (1)
			exp_bool[i] = true;
			// update the explosion parameters
			exp_x[i] = (bomb_index_r[i] * BUILDING_SIZE) + OFFSET;
			exp_y[i] = bomb_oldy[i] + BOMB_SIZE - 1;
			exp_oldx[i] = exp_x[i];
			exp_oldy[i] = exp_y[i];
		}
		// left corner check
		else if((bomb_yarr[i] + BOMB_SIZE == y_arr[bomb_index_l[i]] + 1 + bomb_speed) && bomb_index_l[i] >= 0 && bomb_index_l[i] < 12){ 	// check bomb_hitbox
			// erase block
			bomb_oldy[i] = y_arr[bomb_index_l[i]] + 1 - BOMB_SIZE;
			bomb_oldx[i] = bomb_xarr[i];
			bomb_xarr[i] = RESOLUTION_X; 	// set location off the map
			bomb_yarr[i] = 0;
			// decrement the y_arr, col_arr?
			y_arr[bomb_index_l[i]] += BUILDING_SIZE;
			col_arr[bomb_index_l[i]] -= 1;
			// set explosion stage to start (1)
			exp_bool[i] = true;
			// update the explosion parameters
			exp_x[i] = (bomb_index_l[i] * BUILDING_SIZE) + OFFSET;
			exp_y[i] = bomb_oldy[i] + BOMB_SIZE - 1;
			exp_oldx[i] = exp_x[i];
			exp_oldy[i] = exp_y[i];
		}
		else if(bomb_xarr[i] == RESOLUTION_X){
			bomb_yarr[i] = 0;
		}
		else{
			bomb_yarr[i] += bomb_speed;  	// update the y value
		}
	}
	
}

void explosion_animation(){
	// EXPLOSION ANIMATION
	// For loop to iterate through the array
	for(int i = 0; i < BOMB_NUM; i++){
		// Clear the previous stage
		explosion(exp_oldx[i], exp_oldy[i], exp_stage[i], ERASE);
		if(exp_stage[i] == 0 || exp_stage[i] == 7){
			// skip - don't draw
		}
		else if(exp_oldx[i] == RESOLUTION_X){
			// skip - don't draw
		}
		else{
			explosion(exp_x[i], exp_y[i], exp_stage[i], CREATE);
		}
		// Move to next stage?
		if(exp_stage[i] == 7){
			exp_stage[i] = 0;
			exp_bool[i] = false;
			exp_oldx[i] = RESOLUTION_X;
			exp_oldy[i] = 0;
		}
		else if(exp_bool[i]){
			exp_stage[i]++;
		}
	}
}

int main(void){
	// interrupt setup
	set_A9_IRQ_stack();
    config_GIC();
    config_KEYs();
    enable_A9_interrupts();
	// use pushbutton zero? set up interrupts
	// randomization so that on each restart the column array will be different
	srand(time(NULL));
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
    // set front pixel buffer to start of FPGA On-chip memory
	// initialize the back buffer
    *(pixel_ctrl_ptr + 1) = 0xC8000000; 
	// we draw on the back buffer
	pixel_buffer_start = *(pixel_ctrl_ptr + 1);
	// clear the screen at the start of the game
	draw_blank();
	wait_for_vsync();
	pixel_buffer_start = *(pixel_ctrl_ptr + 1);
	draw_blank();

	while(diff_select == false){
		if(difficulty_change){
			if(index == 2){
				index = 0;
			}
			else{
				index++;
			}
			draw_blank();
			draw_difficulty_screen(difficulty_range[index]);
			difficulty_change = false;
		}
		else{
			draw_difficulty_screen(difficulty_range[index]);
		}
		wait_for_vsync();
		pixel_buffer_start = *(pixel_ctrl_ptr + 1);
	}
	// while loop to stay in start screen until a button is pressed
	while(start == false){
		draw_start_screen();
		wait_for_vsync();
		pixel_buffer_start = *(pixel_ctrl_ptr + 1);
	}
	// reset its value
	start = false;
	diff_select = false;
	// generate the randomized building arrangement
	gen_building();
    clear_screen(); 
	// for loop iterating through the column array to build
    // swap the front/back buffers, to set the front buffer location
    wait_for_vsync();
    // reinitialize back pixel buffer to start of SDRAM memory 
    *(pixel_ctrl_ptr + 1) = 0xC0000000;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); 
	// pixel_buffer_start points to the pixel buffer
    clear_screen(); 

	// initialize the bomb arrays off the screen
	for(int k = 0; k < BOMB_NUM; k++){
		bomb_xarr[k] = RESOLUTION_X;
		bomb_oldx[k] = RESOLUTION_X;
		bomb_yarr[k] = 0;
		bomb_oldy[k] = 0;
		exp_stage[k] = 0;
		exp_x[k] = RESOLUTION_X;
		exp_y[k] = 0;
		exp_oldx[k] = RESOLUTION_X;
		exp_oldy[k] = 0;
		exp_bool[k] = false;
	}
	
	bomb_count = 0; // reset bomb count to 0 in case KEY 1 interrupts changed it
	plane_speed = 2; // reset the plane speed to 2?

    while(1)
    {
		draw_bomb_counter();
		plane_animation();
        bomb_animation();
		explosion_animation();
        wait_for_vsync(); // swap front and back buffers on VGA vertical sync
        pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer

		// if statement to check when end is reached?
		if(end){
			break;
		}
    }

	// end screens
	if(crash){
		// crash - game over
		// unfinished
		crash_screen();
		wait_for_vsync();
	}
	else if(win){
		victory_screen();
		wait_for_vsync();
		
	}
}

// code for interrupt subroutines
void config_KEYs(){
    volatile int * KEY_ptr = (int*) KEY_BASE;
    *(KEY_ptr + 2) = 0xFF; 
	// enables interrupts on both KEY 1 and KEY 0
}

void set_A9_IRQ_stack(){
    int stack, mode;
    stack = A9_ONCHIP_END - 7;

    mode = INT_DISABLE | IRQ_MODE;
    asm("msr cpsr, %[ps]" : : [ps] "r"(mode));

    asm("mov sp, %[ps]" : : [ps] "r"(stack));

    mode = INT_DISABLE | SVC_MODE;
    asm("msr cpsr, %[ps]" : : [ps] "r"(mode));
}

void enable_A9_interrupts(){
    int status = SVC_MODE | INT_ENABLE;
    asm("msr cpsr, %[ps]" : : [ps] "r"(status));
}

void config_GIC(){
    int address;

    *((int *)0xFFFED8C4) = 0x01000000;
    *((int *)0xFFFED118) = 0x00000080;

    *((int *)0xFFFED848) = 0x00000101;
    *((int *)0xFFFED108) = 0x00000300;

    address = MPCORE_GIC_CPUIF + ICCPMR;

    *((int *)address) = 0xFFFF;

    address = MPCORE_GIC_CPUIF + ICCICR;
    *((int *)address) = ENABLE;

    address = MPCORE_GIC_DIST + ICDDCR;
    *((int *)address) = ENABLE;
}

// KEY_ISR --> what to do when KEY is pressed
void pushbutton_ISR(){
    volatile int * KEY_ptr = (int *)KEY_BASE;
    int press;
    press = *(KEY_ptr + 3);
    *(KEY_ptr + 3) = press;

	if(press == 1 && diff_select == true){ 		// KEY 0 is pressed
		start = true;
	}
	else if(press == 2){				 	// KEY 1 
		if(bomb_count == BOMB_NUM){ 			 // if maximum bombs used, don't do anything
			return;					
		}
		else{
			bomb_xarr[bomb_count] = plane_x + 13;// hold current x + 13
			bomb_yarr[bomb_count] = plane_y + 8; // hold current y + 8
			bomb_count += 1;					 // increment bomb count
		}
	}
	else if(press == 4){			// KEY 2 changes difficulty level
		difficulty_change = true;
	}
	else if(press == 8){				// KEY 3 sets the difficulty
		diff_select = true;
	}
}
